import React, { useRef, useEffect, useState, useCallback, Ref } from "react";
import { useSpring, animated } from "react-spring";
import { Grid, DialogContent, Paper } from "@material-ui/core";
import im1 from "./images/modalpic1.jpg";
import im2 from "./images/modalpic2.jpg";
import im3 from "./images/modalpic3.png";
import im4 from "./images/modalpic4.jpg";

interface ImodalForm {
  CloseModalForm: (backbutton: number) => void;
  showModalForm: boolean;
  setShowModalForm: (showModal: boolean) => void;
  PaperStyle: string;
}

export default function Modalx({
  CloseModalForm,
  showModalForm,
  setShowModalForm,
  PaperStyle,
}: ImodalForm): JSX.Element {
  const [showimage, setShowimage] = useState<string>(" ");
  const [zoomedModal, setZoomedModal] = useState<boolean>(false);
  const [wideImage, setWideImage] = useState<boolean>(false);

  //
  //
  //
  //CREATE A SLIDE UP ANIMATION WITH  REACT SPRING
  const animation = useSpring({
    config: {
      duration: 1000,
    },
    opacity: showModalForm ? 1 : 0.9,
    transform: showModalForm ? `translateY(0%)` : `translateY(100%)`,
  });

  //
  //
  //
  // USEREF TARGETS A DIV(BACKGROUND) AND CLOSES MODAL ON CLICK
  const ModalBackgroundRef = useRef<HTMLInputElement>(null);

  const onBackgroundFocus = (e: any): void => {
    if (ModalBackgroundRef.current === e.target) {
      CloseModalForm(0);
    }
  };
  //
  //
  //
  // ESCAPE KEY CLOSE MODAL
  const escapePress = useCallback(
    (e) => {
      if (e.key === "Escape" && showModalForm) {
        CloseModalForm(0);
      }
    },
    [setShowModalForm, showModalForm]
  );
  useEffect(() => {
    document.addEventListener("keydown", escapePress);
    return () => document.removeEventListener("keydown", escapePress);
  }, [escapePress]);

  //
  //
  //
  // RANDOMISE IMAGE
  useEffect(() => {
    let imagecontrol: number[] = [1, 2, 3, 4];
    var randomimage =
      imagecontrol[Math.floor(Math.random() * imagecontrol.length)];
    if (randomimage == 1) {
      setShowimage(im1);
    } else if (randomimage == 2) {
      setShowimage(im2);
    } else if (randomimage == 3) {
      setShowimage(im3);
    } else {
      setShowimage(im4);
    }
  }, []);

  const imgElement = React.useRef<HTMLImageElement>(null);

  const onimageload = (e: any) => {
    const imageHeight = e.target.clientHeight;
    const imageWidth = e.target.clientWidth;
    if (imageWidth > imageHeight) {
      setWideImage(true);
    }
  };

  const wideImageControlTrue: string = "80vw";
  let wideImageControl: string = "70vw";

  {
    wideImage ? (wideImageControl = wideImageControlTrue) : null;
  }
  return (
    <>
      {showModalForm ? (
        <DialogContent
          className="dialog-container dontallowhighlighting "
          onClick={onBackgroundFocus}
          style={{
            overflow: "hidden",
            height: "100vh",
            width: "100%",
            position: "fixed",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            top: "0em",
            zIndex: 8,
            backgroundImage:
              "linear-gradient(to bottom,rgb(160, 160, 160, 1),rgb(160, 160, 160, 0.95),rgb(160, 160, 160, 0.9),rgb(160, 160, 160, 0.85),rgb(160, 160, 160, 0.8)",
          }}
          ref={ModalBackgroundRef}
        >
          <animated.div style={animation}>
            <Paper className={PaperStyle} style={{ borderRadius: "11px" }}>
              <Grid
                container
                xs={12}
                style={{
                  width: wideImageControl,
                  height: "auto",
                  boxShadow: "0 5px 16px rgba(0, 0, 0, 0.2)",
                  color: "#000000",
                  position: "relative",
                  zIndex: 10,
                  borderRadius: "11px",
                }}
              >
                <Grid item xs={6}>
                  <img
                    onLoad={onimageload}
                    src={showimage}
                    style={{
                      objectFit: "cover",
                      width: "100%",
                      height: "100%",
                      borderRadius: "11px 0 0 10px",
                      background: "#000000",
                    }}
                    alt="camera"
                  />
                </Grid>

                <Grid
                  xs={6}
                  item
                  style={{
                    display: "flex",
                    flexDirection: "column",
                    justifyContent: "center",
                    alignItems: "center",
                    lineHeight: "1.8",
                    textAlign: "center",
                    color: "#141414",
                  }}
                >
                  <h1>Camera</h1>
                  <p>get access</p>
                  <button>join</button>
                </Grid>
              </Grid>
            </Paper>
          </animated.div>
        </DialogContent>
      ) : null}
    </>
  );
}
